import React, { useState } from 'react';
import { createProfile } from '../api';
cre

function CreateProfileForm() {
  const [formData, setFormData] = useState({
    type: 'Personal',
    name: '',
    email: '',
    address: '',
    contact: '',
    website: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await createProfile(formData);
      if (response.message === 'Profile created successfully') {
        // Redirect to the profile details page or display a success message
        // You can implement this based on your app's navigation logic.
        // For now, you can just console.log(response) to see the API response.
        console.log(response);
      } else {
        console.error('Profile creation failed');
      }
    } catch (error) {
      console.error('Error creating profile', error);
    }
  };

  return (
    <div>
      <h2>Create Profile</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Type:</label>
          <select name="type" value={formData.type} onChange={handleChange}>
            <option value="Personal">Personal</option>
            <option value="Organization">Organization</option>
          </select>
        </div>
        <div>
          <label>Name:</label>
          <input type="text" name="name" value={formData.name} onChange={handleChange} required />
        </div>
        <div>
          <label>Email:</label>
          <input type="email" name="email" value={formData.email} onChange={handleChange} required />
        </div>
        <div>
          <label>Address:</label>
          <input type="text" name="address" value={formData.address} onChange={handleChange} />
        </div>
        <div>
          <label>Contact:</label>
          <input type="text" name="contact" value={formData.contact} onChange={handleChange} />
        </div>
        <div>
          <label>Website:</label>
          <input type="url" name="website" value={formData.website} onChange={handleChange} />
        </div>
        <div>
          <button type="submit">Create Profile</button>
        </div>
      </form>
    </div>
  );
}

export default CreateProfileForm;
